window.bookSummaryJSON = "<p>A new standalone romance from <i>USA Today</i> best-selling author Meghan Quinn and narrated by Tim Paige and Kelsey Navarro....</p> <p>I haven't seen her in three years.&nbsp;</p> <p>I haven't talked to her since the kiss.&nbsp;</p> <p>So why am I on a plane, flying across the world to spend a week with her in Germany?&nbsp;</p> <p>One word: Pops.&nbsp;</p> <p>My life’s a mess.&nbsp;</p> <p>My possible football career is hanging on by a thread.&nbsp;</p> <p>I'm driving the roads of Germany in honor of Pops with the one girl I can never have.&nbsp;</p> <p>And I’m sharing a bed with her, the girl I've measured everyone else up to, while desperately trying to not to touch her.&nbsp;</p> <p>We made a pact growing up, never to get romantic with each other - never fall in love.&nbsp;</p> <p>And I'm about to break that pact. For good.&nbsp;</p> <p><b>Kings of Football series&nbsp;</b></p> <p><i>The Revenge Pact</i> by Ilsa Madden-Mills&nbsp;</p> <p><i>The Romantic Pact</i> by Meghan Quinn&nbsp;</p> <p><i>The Relationship Pact</i> by Adriana Locke</p>"; 
